var posY = 0;
$(".filter-burger__checkbox").change(function() {
	if ($(".filter-burger__checkbox").prop("checked")) {
		posY = $(window).scrollTop();
		$("body").addClass("no-scroll");
		$("body").scrollTop(posY);
		$(".personal__aside, .catalog-filter").css("right", "0px");
	} else {
		$("body").removeClass("no-scroll");
		$(window).scrollTop(posY);
		$(".personal__aside, .catalog-filter").css("right", "-270px");
	};
});
